const About = () => (
  <div className="p-8">
    <h1 className="text-3xl font-semibold mb-4">About Us</h1>
    <p className="mb-4">Millennial is a modern IT firm focused on quality, scalability, and innovation.</p>
    <img
      src="https://source.unsplash.com/featured/?teamwork"
      alt="About Us"
      className="rounded-lg shadow-md w-full max-w-2xl mx-auto"
    />
  </div>
);

export default About;
